import React from 'react';
import '../styles/ArtworkList.css';
import img1 from '../static/god1.jpg';
import img2 from '../static/god2.jpg';
import img3 from '../static/god3.jpg';
import img4 from '../static/Paint1.jpg';
import img5 from '../static/paint2.jpg';
import img6 from '../static/god.jpg';
import img7 from '../static/art3.jpg'; // Import the CSS file

const artworks = [
  { id: 1, artist: 'Artist One', cost: '$100', imageUrl: img1 },
  { id: 2, artist: 'Artist Two', cost: '$200', imageUrl: img2 },
  { id: 3, artist: 'Artist Three', cost: '$150', imageUrl: img3 },
  { id: 4, artist: 'Artist Four', cost: '$250', imageUrl: img4 },
  { id: 5, artist: 'Artist Five', cost: '$300', imageUrl: img5 },
  { id: 6, artist: 'Artist Six', cost: '$180', imageUrl: img6 },
];

export default function ArtworkList() {
  return (
    <div className="artwork-list">
      <h1>Artworks</h1>
      <div className="artwork-container">
        {artworks.map((artwork) => (
          <div key={artwork.id} className="artwork-item">
            <img src={artwork.imageUrl} alt={artwork.artist} />
            <h2>{artwork.artist}</h2>
            <p>Cost: {artwork.cost}</p>
            <button className="cart-button">Add to Cart</button>
          </div>
        ))}
      </div>
    </div>
  );
}
